export default {
  SetProductsAPI({ commit }, payload) {
    commit("SET_PRODUCTS_API", payload);
  },

  CategoryFood({ commit }, payload) {
    commit("SET_PRODUCTS_BY_CATEGORY", payload);
  },
};
